/*!50003 CREATE*/ /*!50017 DEFINER=`improov`@`10.%`*/ /*!50003 TRIGGER `log_alteracoes_trigger` AFTER UPDATE ON `funcao_imagem` FOR EACH ROW BEGIN
  DECLARE data_registro DATETIME;

  -- Verifica se há uma data definida na tabela funcao_imagem
  SELECT COALESCE(NEW.prazo, NOW()) INTO data_registro;

  IF OLD.status != NEW.status THEN
    INSERT INTO log_alteracoes (funcao_imagem_id, status_anterior, status_novo, data, colaborador_id)
    VALUES (NEW.idfuncao_imagem, OLD.status, NEW.status, data_registro, NEW.colaborador_id);
  END IF;
END */;;
