CREATE TABLE `imagens_cliente_obra` (
  `idimagens_cliente_obra` int(11) NOT NULL AUTO_INCREMENT,
  `cliente_id` int(11) NOT NULL,
  `obra_id` int(11) NOT NULL,
  `imagem_nome` varchar(255) COLLATE utf8mb4_unicode_ci NOT NULL,
  `recebimento_arquivos` date DEFAULT NULL,
  `data_inicio` date DEFAULT NULL,
