/*!50003 CREATE*/ /*!50017 DEFINER=`improov`@`10.%`*/ /*!50003 TRIGGER `log_status_followup` AFTER UPDATE ON `imagens_cliente_obra` FOR EACH ROW BEGIN
    IF OLD.status_id != NEW.status_id THEN
        INSERT INTO log_followup (imagem_id, status_anterior, status_novo, data)
        VALUES (NEW.idimagens_cliente_obra,
                OLD.status_id,  -- Status anterior
                NEW.status_id,  -- Novo status
                NOW());         -- Data da alteração
    END IF;
END */;;
